let emotionList = [
  {
    emotion_id: 1,
    emotion_img: process.env.PUBLIC_URL + `/assets/emotion1.png`,
    emotion_discript: "완전 좋음",
  },
  {
    emotion_id: 2,
    emotion_img: process.env.PUBLIC_URL + `/assets/emotion2.png`,
    emotion_discript: "좋음",
  },
  {
    emotion_id: 3,
    emotion_img: process.env.PUBLIC_URL + `/assets/emotion3.png`,
    emotion_discript: "그럭저럭",
  },
  {
    emotion_id: 4,
    emotion_img: process.env.PUBLIC_URL + `/assets/emotion4.png`,
    emotion_discript: "나쁨",
  },
  {
    emotion_id: 5,
    emotion_img: process.env.PUBLIC_URL + `/assets/emotion5.png`,
    emotion_discript: "끔찍함",
  },
];

const DiaryPage = ({ pageData }) => {
  const env = process.env;
  env.PUBLIC_URL = env.PUBLIC_URL || "";

  console.log(emotionList[pageData.emotion - 1]);

  return (
    <div className="DiaryPage">
      <section>
        <h4>오늘의 감정</h4>
        <div
          className={`diary_img_wrapper diary_img_wrapper_${pageData.emotion}`}
        >
          <img src={emotionList[pageData.emotion - 1].emotion_img}></img>
          <div className="emotion_discript"></div>
        </div>
      </section>
      <section>
        <h4>오늘의 일기</h4>
        <div className="diary_content_wrapper">
          <p>{pageData.content}</p>
        </div>
      </section>
    </div>
  );
};

export default DiaryPage;
